import React from 'react';

import { Container } from './styles';

export default function Sidebar() {
  return (
    <Container>
      <ul>
        <li>Vendas</li>
        <li>Clientes</li>
        <li>Carteira</li>
        <li>Contato</li>
      </ul>
    </Container>
  );
}
